import React from 'react'
import { Link } from 'react-router-dom'
//import {withRouter} from 'react-router';
import { useLocation } from "react-router-dom"
import {useNavigate,location} from 'react-router-dom';


const currentTab =(history,path)=>{
  const location = useLocation();
  if(window.location.pathname===path){
    return {color:"#FFFFFF"}
  }else{
    return {color:"#d1d1d1"}
  }
}

const Menu =({history}) => {
  const navigate = useNavigate();
  return (
    <div>
      <ul className="nav justify-content-end">
      <li className="nav-item">
    <Link 
    style={currentTab(history,"/")} 
    className="nav-link"  aria-current="page" 
    navigate="/" >Home</Link>
  </li>
  <li className="nav-item">
    <Link 
    style={currentTab(history,"/cart")} 
    className="nav-link" 
    to="/cart">Cart</Link>
  </li>
  <li className="nav-item">
    <Link style={currentTab(history,"/dashboard")}  className="nav-link" to="/dashboard">Dashboard</Link>
  </li>
  <li className="nav-item">
    <Link style={currentTab(history,"/")}  className="nav-link" href="/">Admin Dashboard</Link>
  </li>
  <li className="nav-item">
    <Link style={currentTab(history,"/")}  className="nav-link" href="/">SignIn</Link>
  </li>
  <li className="nav-item">
    <Link style={currentTab(history,"/")}  className="nav-link" href="/">SignUp</Link>
  </li>
  <li className="nav-item">
    <Link style={currentTab(history,"/")}  className="nav-link" href="/">SignOut</Link>
  </li>
</ul>
    </div>
  )
}

// export default withRouter(Menu)
export default Menu
